public double MedianOfFive(double a, double b, double c, double d, double e)\n{\n    // Step 1: Compare and order pairs (a,b) and (c,d)\n    if (b < a) { double temp = a; a = b; b = temp; } // a <= b\n    if (d < c) { double temp = c; c = d; d = temp; } // c <= d\n\n    // Step 2: Compare the lower of each pair\n    if (c < a) { double tempA = a, tempB = b; a = c; b = d; c = tempA; d = tempB; } // b <= a <= d\n    \n    // Step 3: Include e with the unpaired number (in this case, it's c)\n    if (e < c) { double temp = c; c = e; e = temp; } // c <= e\n\n    // Step 4: Compare the lower of the pairs again\n    if (d < a) { double temp = b; b = d; d = a; a = temp; } // a <= d\n\n    // Step 5: Final comparison between middle candidates, return the median\n    if (b < c) return c;\n    return b;\n}